import React from 'react';
import Todo from '../Todo/Todo';

TodoList.propTypes = {};

function TodoList({ todoList }) {
	return (
		<div>
			{todoList.map((data) => (
				<Todo data={data} />
			))}
		</div>
	);
}

export default TodoList;
